import React, { memo } from 'react';
import { Routes, Route } from 'react-router-dom';
import GlobalStyles from './GlobalStyles';
import LargeBread from './pages/LargeBread';

const App = memo(() => {
  return (
    <div>
      <GlobalStyles/>
      <Routes>
        <Route path='/product/:api' exact element={<LargeBread/>}/>
        </Routes>
    </div>
  );
});

export default App;
